{% block body -%}
    <h4 class=\"mt-5 mb-5\">Category List
        <a href=\"{{ path('category_new') }}\" class=\"float-right btn btn-sm btn-primary\">Create a new entry</a>
    </h4>

    <table class=\"records_list table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Status</th>
                <th>Actions</th>
            </tr>
        </thead>
        <tbody>
        {% for entity in entities %}
            <tr>
                <td><a href=\"{{ path('category_show', { 'id': entity.id }) }}\">{{ entity.id }}</a></td>
                <td>{{ entity.name }}</td>
                <td>{{ entity.status }}</td>
                <td>
                    <a href=\"{{ path('category_show', { 'id': entity.id }) }}\" class=\"btn  btn-sm btn-success\">show</a>
                    <a href=\"{{ path('category_edit', { 'id': entity.id }) }}\" class=\"btn  btn-sm btn-secondary\">edit</a>
                </td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

{% endblock %}", "BookstoreDefaultBundle:Category:index.html.twig", "/var/www/html/_bookstore/src/Bookstore/DefaultBundle/Resources/views/Category/index.html.twig");
